<style>
  * {
    font-family: 'Cabin', sans-serif;
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    overflow: hidden;
  }

  body {
    background-color: rgb(13, 47, 49);
  }

  img {
    width: 40px;
  }

  /* .tooltip{
    } */
  .tooltip-inner {
    margin-right: 50px;
    background-color: #efcca2;
    color: #800000;
    border-radius: 4px;
    font-size: 20px;
    padding: 10px 10px;
    display: flex;
    align-items: center;
    justify-content: center;
  }

  /* CSS */
  .button-15 {
    background-image: linear-gradient(#F9EEE4, rgb(244, 200, 126));
    border: 1px solid maroon;
    border-radius: 4px;
    box-sizing: border-box;
    color: #FFFFFF;
    cursor: pointer;
    direction: ltr;
    display: block;
    font-family: "SF Pro Text", "SF Pro Icons", "AOS Icons", "Helvetica Neue", Helvetica, Arial, sans-serif;
    font-size: 27px;
    font-weight: 400;
    letter-spacing: -.022em;
    line-height: 1.47059;
    min-width: 30px;
    overflow: visible;
    padding: 4px 15px;
    text-align: center;
    /* vertical-align: baseline; */
    user-select: none;
    -webkit-user-select: none;
    touch-action: manipulation;
    white-space: nowrap;
    z-index: 5;
    position: absolute;
    top: 10px;
    left: 10px;
  }

  .button-15:disabled {
    cursor: default;
    opacity: .3;
  }

  .button-15:hover {
    background-image: linear-gradient(#F9EEE4, rgb(244, 200, 126));
    border-color: maroon;
    text-decoration: none;
  }

  .button-15:active {
    background-image: linear-gradient(#F9EEE4, rgb(244, 200, 126));
    border-color: maroon;
    outline: none;
  }

  .button-15:focus {
    box-shadow: rgba(209, 76, 14, 0.5) 0 0 0 3px;
    outline: none;
  }

  .inst {
    background-color: rgb(225, 202, 202);
    font-size: medium;
    color: maroon;
    position: absolute;
    padding: 5px 10px;
    bottom: 0;
    left: 40%;
  }

  .left {
    position: absolute;
    z-index: 2;
    top: 50%;
    left: 1%;
    background-color: transparent;
    color: white;
    font-size: 30px;
    border-radius: 100%;
    height: 50px;
    width: 50px;
    cursor: pointer;
  }

  .left:hover {
    background-color: #FFFFFF;
    color: black;
  }

  .right {
    position: absolute;
    z-index: 2;
    top: 50%;
    right: 1%;
    background-color: transparent;
    color: white;
    font-size: 30px;
    border-radius: 100%;
    height: 50px;
    width: 50px;
    cursor: pointer;
  }

  .right:hover {
    background-color: #FFFFFF;
    color: black;
  }

  .dy {
    background-color: rgb(249, 238, 228);
    width: fit-content;
    padding: 2rem;
    border-radius: 4px;
    position: absolute;
    right: 10px;
    bottom: 0;
    color: maroon;
  }
  nav {
    position: fixed;
    background-color: transparent;
    z-index: 4;
    width: 100%;
    height: 4rem;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    box-shadow: rgba(80, 90, 93, 0.55) 0px 30px 60px -12px inset, rgba(0, 0, 0, 0.3) 0px 18px 36px -18px inset;
  }

  nav li {
    list-style: none;
    padding: 0 1rem;

  }

  nav ul {
    display: flex;
    align-items: center;
    justify-content: flex-end;
  }

  nav li a {
    color: whitesmoke;
    display: flex;
    /* margin: 5px 5px; */
    font-weight: bold;
    text-decoration: none;
  }

  nav li a:hover {
    color: maroon;
    transition: 500ms;
  }
  @media screen and (max-width:600px) {
    svg {
      width: 100vw;
      height: 100vh;
    }

    .inst {
      left: 0;
      font-size: small;
    }

    .dy {
      font-size: 15px;
      right: 0;
      padding: 10px;
    }
    .left, .right{
      font-size: 10px;
      height: 30px;
      width: 30px;
    }
    .tooltip-inner {
    margin-right: 30px;
    background-color: #efcca2;
    color: #800000;
    border-radius: 4px;
    font-size: 15px;
    padding: 2px;
    display: flex;
    align-items: center;
    justify-content: center;
  }
  img {
    width: 20px;
  }
  nav ul {
      margin-right: 0;
    }

    nav li a {
      display: flex;
      align-items: center;
      justify-content: center;
      margin: 0;
      font-size: small;
    }

    nav li {
      padding: 10px;
      display: flex;
      align-items: center;
    }
  }
</style>
